import React from "react";
export default function Multiple({nmbr}){
    let nbrOperation=[1,2,3,4,5]
    return(
        <div>
            <table>
                <tr>
                    <th>nomber1</th>
                    <th>operation</th>
                    <th>nomber2</th>
                    <th>resultat</th>
                </tr>
               
                { nmbr?nbrOperation&&nbrOperation.map((rslt)=>{
                    return<tr>
                        <td>{rslt}</td>
                        <td>x</td>
                        <td>{nmbr}</td>
                        <td>{rslt*nmbr}</td>
                    </tr>
                }):<div>vide</div>}
                
            </table>
        </div>
    )
}
